import { BinaryHeap, ascend } from 'jsr:@std/data-structures';

/* 初始化堆 */
// 初始化小顶堆
const minHeap = new BinaryHeap<number>(ascend);
// 初始化大顶堆
const maxHeap = new BinaryHeap<number>();

/* 元素入堆 */
maxHeap.push(1);
maxHeap.push(3);
maxHeap.push(2);
maxHeap.push(5);
maxHeap.push(4);

/* 获取堆顶元素 */
let peek = maxHeap.peek(); // 5

/* 堆顶元素出堆 */
// 出堆元素会形成一个从大到小的序列
peek = maxHeap.pop(); // 5
peek = maxHeap.pop(); // 4
peek = maxHeap.pop(); // 3
peek = maxHeap.pop(); // 2
peek = maxHeap.pop(); // 1

/* 获取堆大小 */
const size = maxHeap.length;

/* 判断堆是否为空 */
const isEmpty = maxHeap.isEmpty();

/* 输入列表并建堆 */
